import { View } from 'react-native';
import { Screens } from '../types'
import type { Screen } from '../types';

export const TodoListScreen = () => {
  return (<View>Todo List Screen</View>)
}

const screen: Screen = {
  name: Screens.TodoList,
  subTitle: 'Todo List',
  component: TodoListScreen
}
